import React, { Component } from 'react';
import { Media } from 'reactstrap';

class Award extends Component {
    render() {
        return (
            <div className = "container">
                <div className = "row">
                    <div className = "col-12">
                        <div className = "text-center text-success m-3">
                            <h1 heading className = "text-info">Awards</h1>
                            <h3 body className = "font-weight-normal p-3">
                                David Chu's China Bistro is a recepient of multiple awards for its great food and service. <br />
                                <i>Details are coming soon...</i>
                            </h3>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
};

export default Award;
